css:
@-moz-document domain("sel3.ebsoc.co.kr"), domain("sel2.ebsoc.co.kr"), domain("sel1.ebsoc.co.kr"), domain("chj.ebsoc.co.kr")
{
:root {
    --animate-duration: 1s;
    --animate-delay: 1s;
    --animate-repeat: 1;
    -webkit-animation-name: spin;
    -webkit-animation-duration: 10000ms;
    -webkit-animation-iteration-count: infinite;
    -webkit-animation-timing-function: linear;
}
}

@-moz-document domain("ebs3-meeting.dooray.com"), domain("ebs2-meeting.dooray.com"), domain("ebs1-meeting.dooray.com")
{
element.style {
    -webkit-animation-name: spin;
    -webkit-animation-duration: 1ms;
    -webkit-animation-iteration-count: infinite;
    -webkit-animation-timing-function: linear;
}
}
